<html>

<head>
    <link rel="stylesheet" type="text/css" href="default.css">
</head>

<body>
    <script type="text/javascript" src="page.js"></script>
    <script type="text/javascript" src="header-parser-ro.js"></script>
    <script type="text/javascript" src="header-parser-a2.js"></script>
    <script type="text/javascript" src="header-parser-im.js"></script>
    <script type="text/javascript" src="header-parser-3pm.js"></script>
    <script type="text/javascript" src="parse-headers.js"></script>
    <script type="text/javascript" src="display-im.js"></script>
    <script type="text/javascript" src="display-ro.js"></script>
    <script type="text/javascript" src="display-a2.js"></script>
    <script type="text/javascript" src="display-3pm.js"></script>
    <script type="text/javascript" src="display-common.js"></script>
    <script type="text/javascript" src="googanalytics.js"></script>
    <script type="text/javascript" src="report.js"></script>
    <div class="container">
        <div id="conversionSummary" class="rowFixTop clearfix">
        </div>
        <div class="clearfix">
            <div id="compareWrapper">
                <div style="display:none" id="imageBox" class="col-image-box">
                    <div id="close">&#215;</div>
                    <div id="compareTitle" class="img-align"></div>
                    <!-- Image -->
                    <div id="imageCompare">
                        <div id='imageCompareBox' class="compareBox">
                            <div id="imageCompareOrig" class="compareOrig">
                                <div id="imageAjaxLoader1" class="ajaxLoader" style="display:none;"></div>
                                <img id="originalImage" class="originalImage">
                                <p id="originalImageText">Original</p>
                                <div id="originalImageValues"></div>
                            </div>
                            <div id="imageCompareTran" class="compareTran">
                                <div id="imageAjaxLoader2" class="ajaxLoader" style="display:none;"></div>
                                <img id="transformedImage" class="transformedImage">
                                <p id="transformedImageText">Transformed</p>
                                <div id="transformedImageValues"></div>
                            </div>
                        </div>
                    </div>
                    <!-- Video -->
                    <div id="videoCompare">
                        <div id="videoCompareBox" class="compareBox">
                            <div id="videoCompareOrig" class="compareOrig">
                                <div id="videoAjaxLoader1" class="ajaxLoader" style="display:none;"></div>
                                <video id="originalVideo" loop></video>
                                <p id="originalVideoText">Original</p>
                                <div id="originalVideoValues"></div>
                            </div>
                            <div id="videoCompareTran" class="compareTran">
                                <div id="videoAjaxLoader2" class="ajaxLoader" style="display:none;"></div>
                                <video id="transformedVideo" loop></video>
                                <p id="transformedVideoText">Transformed</p>
                                <div id="transformedVideoValues"></div>
                            </div>
                        </div>
                    </div>
                    <div id="compareUrl">
                        <p id="compareUrlTitle"></p>
                        <a id="compareUrlLink" target="_blank"></a>
                    </div>
                </div>
            </div>
        </div>
        <div id="conversionDetailsAjaxLoader" class="ajaxLoader" style="display:none;"></div>
        <div id="conversionDetails">
            <div id="detailsBox1" style="display:none" class="row details clearfix">
                <div class="col-full-box">
                    <h3 class="table-title" id="detailsBox1Title">Video Optimization Details</h3>
                    <div id="table-wrapper1">
                        <div class="detailsTable" id="detailsBox1Table"></div>
                    </div>
                </div>
            </div>
            <div id="detailsBox2" style="display:none" class="row details clearfix">
                <div class="col-full-box">
                    <h3 class="table-title" id="detailsBox2Title">Image Optimization Details</h3>
                    <div id="table-wrapper2">
                        <div class="detailsTable" id="detailsBox2Table"></div>
                    </div>
                </div>
            </div>
            <div id="detailsBox3" style="display:none" class="row details clearfix">
                <div class="col-full-box">
                    <h3 class="table-title" id="detailsBox3Title">Optimized Realtime Details</h3>
                    <h3 id="detailsBox3Table"></h3>
                </div>
            </div>
            <div id="detailsBox4" style="display:none" class="row details clearfix">
                <div class="col-full-box">
                    <h3 class="table-title" id="detailsBox4Title">Non Image Manager</h3>
                    <div id="nonImIcBytes" class="subHeaderInfo">&nbsp;</div>
                    <h3 id="detailsBox4Table"></h3>
                </div>
            </div>
        </div>
        <div id="notEnabled" style="display:none" class="details col-full-box clearfix"></div>
    </div>
</body>
<script type="text/javascript" src="devtoolscontent.js"></script>
</html>
